import React from 'react'
import Cards from './components/cards.js'
import Header from './components/header'
import Footer from './components/footer'
function App() {
  return (
    <div>
      <Header />
      <main>
        <Cards />
      </main>
      <Footer/>
    </div>
  );
}

export default App;
